import pytest
import types
from fastapi.exceptions import HTTPException

from semantic_search.ncbi import (
    _medline_to_docs,
    _safe_request,
    _parse_medline,
    _get_eutil_records,
    uids_to_docs,
    Settings,
)

settings = Settings()


def test_invalid_uid_test():
    with pytest.raises(HTTPException):
        uid = ["93846392868"]
        records = [{"id:": [uid]}]
        _medline_to_docs(records)


def test_safe_request():
    eutils_params = {
        "db": "pubmed",
        "id": "9887103",
        "retstart": 0,
        "retmode": "xml",
        "api_key": settings.ncbi_eutils_api_key,
    }
    url = "https://eutils.ncbi.nlm.nih.gov/entrez/eutils/efetch.fcgi"
    assert _safe_request(url, "POST", files=eutils_params).status_code == 200


